      doc: "1）本游戏是一款角色扮演类游戏，适用于年满16周岁及以上的用户，建议未成年人在家长监护下使用本游戏产品。\n\n2）本游戏以南宋为背景，有适量基于历史和现实事件的改编，但不会与现实生活相混淆。游戏玩法侧重于肢体操作，提供丰富的竞技对抗比赛，旨在激励玩家不断提升技能并挑战自我极限。此外，游戏中还融入了创新的社交系统，包括基于文字和语音的陌生人交流功能，让玩家在体验游戏的同时，也能享受社交互动的乐趣。\n\n3）游戏中有用户实名认证系统，未实名账号不能登录游戏。认证为未成年人的用户将接受以下管理：\n支付限制：游戏中部分玩法和道具需要付费。未满8周岁的用户不能付费；8周岁以上未满16周岁的未成年人用户，单次充值金额不得超过50元人民币，每月充值金额累计不得超过200元人民币；16周岁以上的未成年人用户，单次充值金额不得超过100元人民币，每月充值金额累计不得超过400元人民币。\n登录限制：未成年玩家可在周五、周六、周日和法定节假日每日晚20时至21时登录游戏，其他时间无法登录游戏。\n\n4）本游戏将中华传统元素巧妙融入人物造型、场景布置和音乐创作中，不仅为玩家带来沉浸式游戏体验，更致力于传承和推广中华传统文化。游戏中设置创新的组队模式，并设计富有挑战性的大型团队任务和竞赛活动，鼓励玩家之间密切沟通，通过交流与合作共同应对难关，完成目标。通过上述设计，本游戏不仅锻炼玩家间的团队精神，也增强协作解决问题的能力，使玩家在享受游戏操作乐趣的同时，也能结交志同道合的朋友，共同成长。\n"
